import React from "react";
import styles from "./DescricaoVideo.module.css";

function DescricaoVideo( descricao ) {
    return (
        <div className={styles.descricao}>
            <span className={styles.descA}>{descricao}</span>
            {descricao.map((descricao) => (
                <span className={styles.descB}>{descricao.desc}</span>
            ))}
        </div>
    )
}

export default DescricaoVideo;
